import React from 'react'
import './home.css'
import Me from '../../assets/avatar-1.svg'; 

const home = () => {
  return (
    <section className="home container" id="home">
      <div className="intro">
        <img src={ME} alt="" className="home_img" />
      </div>
    </section>
  )
}

export default home
